+(void)UploadImage
{
    dispatch_semaphore_t sema = dispatch_semaphore_create(0);

    NSMutableURLRequest *request = [NSMutableURLRequest requestWithURL:[NSURL URLWithString:@"https://myscrap.com/ios/msEditProfile"]
      cachePolicy:NSURLRequestUseProtocolCachePolicy
      timeoutInterval:10.0];
    NSDictionary *headers = @{
      @"Content-Type": @"application/x-www-form-urlencoded",
      @"Cookie": @"ci_session=5ace93e4b15cdca4b7ca4f81be45323e11622236"
    };

    [request setAllHTTPHeaderFields:headers];
    NSMutableData *postData = [[NSMutableData alloc] initWithData:[@"userId= 12049" dataUsingEncoding:NSUTF8StringEncoding]];
    [postData appendData:[@"&apiKey=47eb3180-7139-476a-82ef-4758a58dcddf" dataUsingEncoding:NSUTF8StringEncoding]];
    [postData appendData:[@"&cardShow=0" dataUsingEncoding:NSUTF8StringEncoding]];
    [postData appendData:[@"&" dataUsingEncoding:NSUTF8StringEncoding allowLossyConversion:NO]];
    [postData appendData:[@"&cardBack=" dataUsingEncoding:NSUTF8StringEncoding allowLossyConversion:NO]];
    [request setHTTPBody:postData];

    [request setHTTPMethod:@"POST"];

    NSURLSession *session = [NSURLSession sharedSession];
    NSURLSessionDataTask *dataTask = [session dataTaskWithRequest:request
    completionHandler:^(NSData *data, NSURLResponse *response, NSError *error) {
      if (error) {
        NSLog(@"%@", error);
      } else {
        NSHTTPURLResponse *httpResponse = (NSHTTPURLResponse *) response;
        NSError *parseError = nil;
        NSDictionary *responseDictionary = [NSJSONSerialization JSONObjectWithData:data options:0 error:&parseError];
        NSLog(@"%@",responseDictionary);
        dispatch_semaphore_signal(sema);
      }
    }];
    [dataTask resume];
    dispatch_semaphore_wait(sema, DISPATCH_TIME_FOREVER);
}
@end
